import React from "react";
import { Button } from "semantic-ui-react";

const Buttons = () => (
  <div>
    <Button content="Prevoius" icon="pause" labelPosition="left" />
    <Button content="Next" icon="right arrow" labelPosition="right" />
  </div>
);

export default Buttons;
